      description: "Creates a Footer. The new footer is applied to the SectionStyle\
        \ at the location of the SectionBreak if specified, otherwise it is applied\
        \ to the DocumentStyle. If a footer of the specified type already exists,\
        \ a 400 bad request error is returned."
      example:
        sectionBreakLocation:
          segmentId: segmentId
          index: 0
        type: HEADER_FOOTER_TYPE_UNSPECIFIED
      properties:
        sectionBreakLocation:
          $ref: '#/components/schemas/Location'
        type:
