          enum:
          - HEADER_FOOTER_TYPE_UNSPECIFIED
          - DEFAULT
          title: type
          type: string
      title: CreateFooterRequest
      type: object
    CreateFooterResponse:
      description: The result of creating a footer.
      example:
        footerId: footerId
      properties:
