          description: The ID of the created footer.
          title: footerId
          type: string
      title: CreateFooterResponse
      type: object
    CreateFootnoteRequest:
      description: Creates a Footnote segment and inserts a new FootnoteReference
        to it at the given location. The new Footnote segment will contain a space
        followed by a newline character.
