    CreateParagraphBulletsRequest:
      description: "Creates bullets for all of the paragraphs that overlap with the\
        \ given range. The nesting level of each paragraph will be determined by counting\
        \ leading tabs in front of each paragraph. To avoid excess space between the\
        \ bullet and the corresponding paragraph, these leading tabs are removed by\
        \ this request. This may change the indices of parts of the text. If the paragraph\
        \ immediately before paragraphs being updated is in a list with a matching\
        \ preset, the paragraphs being updated are added to that preceding list."
      example:
        bulletPreset: BULLET_GLYPH_PRESET_UNSPECIFIED
        range:
          startIndex: 6
          endIndex: 5
          segmentId: segmentId
      properties:
        bulletPreset:
          description: The kinds of bullet glyphs to be used.
          enum:
          - BULLET_GLYPH_PRESET_UNSPECIFIED
          - BULLET_DISC_CIRCLE_SQUARE
          - BULLET_DIAMONDX_ARROW3D_SQUARE
          - BULLET_CHECKBOX
          - BULLET_ARROW_DIAMOND_DISC
          - BULLET_STAR_CIRCLE_SQUARE
          - BULLET_ARROW3D_CIRCLE_SQUARE
          - BULLET_LEFTTRIANGLE_DIAMOND_DISC
          - BULLET_DIAMONDX_HOLLOWDIAMOND_SQUARE
          - BULLET_DIAMOND_CIRCLE_SQUARE
          - NUMBERED_DECIMAL_ALPHA_ROMAN
          - NUMBERED_DECIMAL_ALPHA_ROMAN_PARENS
          - NUMBERED_DECIMAL_NESTED
          - NUMBERED_UPPERALPHA_ALPHA_ROMAN
          - NUMBERED_UPPERROMAN_UPPERALPHA_DECIMAL
          - NUMBERED_ZERODECIMAL_ALPHA_ROMAN
          title: bulletPreset
          type: string
        range:
          $ref: '#/components/schemas/Range'
      title: CreateParagraphBulletsRequest
      type: object
    CropProperties:
      description: "The crop properties of an image. The crop rectangle is represented\
        \ using fractional offsets from the original content's 4 edges. - If the offset\
        \ is in the interval (0, 1), the corresponding edge of crop rectangle is positioned\
        \ inside of the image's original bounding rectangle. - If the offset is negative\
        \ or greater than 1, the corresponding edge of crop rectangle is positioned\
        \ outside of the image's original bounding rectangle. - If all offsets and\
        \ rotation angle are 0, the image is not cropped."
      example:
        offsetTop: 1.284659
        angle: 9.018348
        offsetLeft: 3.5571952
        offsetBottom: 6.4384236
        offsetRight: 6.965118
      properties:
        angle:
          description: "The clockwise rotation angle of the crop rectangle around\
            \ its center, in radians. Rotation is applied after the offsets."
          format: float
          title: angle
          type: number
        offsetBottom:
          description: The offset specifies how far inwards the bottom edge of the
            crop rectangle is from the bottom edge of the original content as a fraction
            of the original content's height.
          format: float
          title: offsetBottom
          type: number
        offsetLeft:
          description: The offset specifies how far inwards the left edge of the crop
            rectangle is from the left edge of the original content as a fraction
            of the original content's width.
          format: float
          title: offsetLeft
          type: number
        offsetRight:
          description: The offset specifies how far inwards the right edge of the
            crop rectangle is from the right edge of the original content as a fraction
            of the original content's width.
          format: float
          title: offsetRight
          type: number
        offsetTop:
          description: The offset specifies how far inwards the top edge of the crop
            rectangle is from the top edge of the original content as a fraction of
            the original content's height.
          format: float
          title: offsetTop
          type: number
      title: CropProperties
      type: object
    CropPropertiesSuggestionState:
      description: "A mask that indicates which of the fields on the base CropProperties\
        \ have been changed in this suggestion. For any field set to true, there's\
        \ a new suggested value."
