    DeleteHeaderRequest:
      description: Deletes a Header from the document.
      example:
        headerId: headerId
      properties:
        headerId:
          description: "The id of the header to delete. If this header is defined\
            \ on DocumentStyle, the reference to this header is removed, resulting\
            \ in no header of that type for the first section of the document. If\
            \ this header is defined on a SectionStyle, the reference to this header\
            \ is removed and the header of that type is now continued from the previous\
            \ section."
          title: headerId
          type: string
      title: DeleteHeaderRequest
      type: object
    DeleteNamedRangeRequest:
      description: Deletes a NamedRange.
      example:
        namedRangeId: namedRangeId
        name: name
      properties:
        name:
          description: The name of the range(s) to delete. All named ranges with the
            given name will be deleted.
          title: name
          type: string
        namedRangeId:
          description: The ID of the named range to delete.
          title: namedRangeId
          type: string
      title: DeleteNamedRangeRequest
      type: object
    DeleteParagraphBulletsRequest:
      description: Deletes bullets from all of the paragraphs that overlap with the
        given range. The nesting level of each paragraph will be visually preserved
        by adding indent to the start of the corresponding paragraph.
      example:
        range:
          startIndex: 6
          endIndex: 5
          segmentId: segmentId
      properties:
        range:
          $ref: '#/components/schemas/Range'
      title: DeleteParagraphBulletsRequest
      type: object
    DeletePositionedObjectRequest:
      description: Deletes a PositionedObject from the document.
      example:
        objectId: objectId
      properties:
        objectId:
          description: The ID of the positioned object to delete.
          title: objectId
          type: string
      title: DeletePositionedObjectRequest
      type: object
    DeleteTableColumnRequest:
      description: Deletes a column from a table.
      example:
        tableCellLocation:
          columnIndex: 6
          rowIndex: 1
          tableStartLocation:
            segmentId: segmentId
            index: 0
      properties:
        tableCellLocation:
          $ref: '#/components/schemas/TableCellLocation'
      title: DeleteTableColumnRequest
      type: object
    DeleteTableRowRequest:
      description: Deletes a row from a table.
      example:
        tableCellLocation:
          columnIndex: 6
          rowIndex: 1
          tableStartLocation:
            segmentId: segmentId
            index: 0
      properties:
        tableCellLocation:
          $ref: '#/components/schemas/TableCellLocation'
      title: DeleteTableRowRequest
      type: object
