          description: "Output only. The revision ID of the document. Can be used\
            \ in update requests to specify which revision of a document to apply\
            \ updates to and how the request should behave if the document has been\
            \ edited since that revision. Only populated if the user has edit access\
            \ to the document. The revision ID is not a sequential number but an opaque\
            \ string. The format of the revision ID might change over time. A returned\
            \ revision ID is only guaranteed to be valid for 24 hours after it has\
            \ been returned and cannot be shared across users. If the revision ID\
            \ is unchanged between calls, then the document has not changed. Conversely,\
            \ a changed ID (for the same document and user) usually means the document\
            \ has been updated. However, a changed ID can also be due to internal\
            \ factors such as ID format changes."
          title: revisionId
