            $ref: '#/components/schemas/SectionColumnProperties'
          title: columnProperties
          type: array
        columnSeparatorStyle:
          description: "The style of column separators. This style can be set even\
            \ when there's one column in the section. When updating this property,\
            \ setting a concrete value is required. Unsetting this property results\
            \ in a 400 bad request error."
