          - COLUMN_SEPARATOR_STYLE_UNSPECIFIED
          - NONE
          - BETWEEN_EACH_COLUMN
          title: columnSeparatorStyle
          type: string
        contentDirection:
          description: "The content direction of this section. If unset, the value\
            \ defaults to LEFT_TO_RIGHT. When updating this property, setting a concrete\
            \ value is required. Unsetting this property results in a 400 bad request\
            \ error."
          enum:
          - CONTENT_DIRECTION_UNSPECIFIED
          - LEFT_TO_RIGHT
          - RIGHT_TO_LEFT
          title: contentDirection
          type: string
