          description: "The ID of the default footer. If unset, the value inherits\
            \ from the previous SectionBreak's SectionStyle. If the value is unset\
            \ in the first SectionBreak, it inherits from DocumentStyle's default_footer_id.\
            \ This property is read-only."
          title: defaultFooterId
          type: string
        defaultHeaderId:
          description: "The ID of the default header. If unset, the value inherits\
            \ from the previous SectionBreak's SectionStyle. If the value is unset\
            \ in the first SectionBreak, it inherits from DocumentStyle's default_header_id.\
            \ This property is read-only."
          title: defaultHeaderId
          type: string
        evenPageFooterId:
          description: "The ID of the footer used only for even pages. If the value\
            \ of DocumentStyle's use_even_page_header_footer is true, this value is\
            \ used for the footers on even pages in the section. If it is false, the\
            \ footers on even pages use the default_footer_id. If unset, the value\
            \ inherits from the previous SectionBreak's SectionStyle. If the value\
            \ is unset in the first SectionBreak, it inherits from DocumentStyle's\
            \ even_page_footer_id. This property is read-only."
          title: evenPageFooterId
          type: string
        evenPageHeaderId:
          description: "The ID of the header used only for even pages. If the value\
            \ of DocumentStyle's use_even_page_header_footer is true, this value is\
            \ used for the headers on even pages in the section. If it is false, the\
            \ headers on even pages use the default_header_id. If unset, the value\
            \ inherits from the previous SectionBreak's SectionStyle. If the value\
            \ is unset in the first SectionBreak, it inherits from DocumentStyle's\
            \ even_page_header_id. This property is read-only."
          title: evenPageHeaderId
          type: string
        firstPageFooterId:
          description: "The ID of the footer used only for the first page of the section.\
            \ If use_first_page_header_footer is true, this value is used for the\
            \ footer on the first page of the section. If it's false, the footer on\
            \ the first page of the section uses the default_footer_id. If unset,\
            \ the value inherits from the previous SectionBreak's SectionStyle. If\
            \ the value is unset in the first SectionBreak, it inherits from DocumentStyle's\
            \ first_page_footer_id. This property is read-only."
          title: firstPageFooterId
          type: string
        firstPageHeaderId:
          description: "The ID of the header used only for the first page of the section.\
            \ If use_first_page_header_footer is true, this value is used for the\
            \ header on the first page of the section. If it's false, the header on\
            \ the first page of the section uses the default_header_id. If unset,\
            \ the value inherits from the previous SectionBreak's SectionStyle. If\
            \ the value is unset in the first SectionBreak, it inherits from DocumentStyle's\
            \ first_page_header_id. This property is read-only."
          title: firstPageHeaderId
          type: string
        flipPageOrientation:
          description: "Optional. Indicates whether to flip the dimensions of DocumentStyle's\
            \ page_size for this section, which allows changing the page orientation\
            \ between portrait and landscape. If unset, the value inherits from DocumentStyle's\
            \ flip_page_orientation. When updating this property, setting a concrete\
            \ value is required. Unsetting this property results in a 400 bad request\
            \ error."
          title: flipPageOrientation
          type: boolean
        marginBottom:
          $ref: '#/components/schemas/Dimension'
        marginFooter:
          $ref: '#/components/schemas/Dimension'
        marginHeader:
          $ref: '#/components/schemas/Dimension'
        marginLeft:
          $ref: '#/components/schemas/Dimension'
        marginRight:
          $ref: '#/components/schemas/Dimension'
        marginTop:
          $ref: '#/components/schemas/Dimension'
        pageNumberStart:
          description: "The page number from which to start counting the number of\
            \ pages for this section. If unset, page numbering continues from the\
            \ previous section. If the value is unset in the first SectionBreak, refer\
            \ to DocumentStyle's page_number_start. When updating this property, setting\
            \ a concrete value is required. Unsetting this property results in a 400\
            \ bad request error."
          format: int32
          title: pageNumberStart
          type: integer
        sectionType:
          description: Output only. The type of section.
          enum:
          - SECTION_TYPE_UNSPECIFIED
          - CONTINUOUS
          - NEXT_PAGE
          title: sectionType
          type: string
        useFirstPageHeaderFooter:
          description: "Indicates whether to use the first page header / footer IDs\
            \ for the first page of the section. If unset, it inherits from DocumentStyle's\
            \ use_first_page_header_footer for the first section. If the value is\
            \ unset for subsequent sectors, it should be interpreted as false. When\
            \ updating this property, setting a concrete value is required. Unsetting\
            \ this property results in a 400 bad request error."
          title: useFirstPageHeaderFooter
          type: boolean
