            \ required revision ID is returned in a response, it indicates the revision\
            \ ID of the document after the request was applied."
          title: requiredRevisionId
          type: string
        targetRevisionId:
          description: "The optional target revision ID of the document the write\
            \ request is applied to. If collaborator changes have occurred after the\
            \ document was read using the API, the changes produced by this write\
            \ request are applied against the collaborator changes. This results in\
            \ a new revision of the document that incorporates both the collaborator\
            \ changes and the changes in the request, with the Docs server resolving\
            \ conflicting changes. When using target revision ID, the API client can\
            \ be thought of as another collaborator of the document. The target revision\
            \ ID can only be used to write to recent versions of a document. If the\
            \ target revision is too far behind the latest revision, the request is\
            \ not processed and returns a 400 bad request error. The request should\
            \ be tried again after retrieving the latest version of the document.\
            \ Usually a revision ID remains valid for use as a target revision for\
            \ several minutes after it's read, but for frequently edited documents\
            \ this window might be shorter."
          title: targetRevisionId
          type: string
      title: WriteControl
      type: object
